import './App.css';
import Nav from './component/Nav';
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route />
        </Routes>
      </Router>
      <Nav/>
     <h1>E-Dashboard</h1>
    </div>
  );
}

export default App;
